            <h2>
                Detekčn&iacute; k&oacute;dy (k z&nbsp;n)
            </h2>
            <h2>
                Hammingův k&oacute;d
            </h2>
            <ul>
                <li>
                    Samoopravn&yacute; k&oacute;d
                </li>
                <li>
                    V&iacute;ce paritn&iacute;ch bitů
                </li>
                <li>
                    Lokalizuje chybu a um&iacute; ji invertov&aacute;n&iacute;m opravit
                </li>
            </ul>
            <h2>
                Č&aacute;rov&eacute; k&oacute;dy
            </h2>
            <ul>
                <li>
                    Mnoho druhů č&aacute;rov&yacute;ch k&oacute;dů kvůli různ&yacute;m norm&aacute;m
                </li>
                <li>
                    Při čten&iacute; jsou generov&aacute;ny el. impulzy
                </li>
                <li>
                    Nositelem informace jsou č&aacute;ry a mezery (různě siln&eacute; a &scaron;irok&eacute;)
                </li>
                <li>
                    Zač&aacute;tek k&oacute;du = sekvence čar, kter&aacute; představuje znak START
                </li>
                <li>
                    Konec k&oacute;du = sekvence čar, kter&aacute; představuje znak STOP
                </li>
                <li>
                    Č&aacute;ra je 1 a mezera 0
                </li>
                <li>
                    Pro čten&iacute; k&oacute;du je důležit&yacute; kontrast
                </li>
                <li>
                    Č&aacute;rov&eacute; k&oacute;dy jsou při čten&iacute; spolehliv&eacute;, chyba může nastat, pouze pokud je k&oacute;d pokrčen&yacute; nebo zdeformovan&yacute;
                </li>
            </ul>
            <h2>
                Magnetick&yacute; k&oacute;d
            </h2>
            <ul>
                <li>
                    Použ&iacute;v&aacute; se magnetick&yacute; p&aacute;sek
                </li>
                <li>
                    Vysok&aacute; životnost
                </li>
                <li>
                    Informace lze přepsat
                </li>
                <li>
                    B&yacute;v&aacute; zaps&aacute;n na kartě
                </li>
                <li>
                    Nev&yacute;hoda je že pobl&iacute;ž magnetick&aacute; indukce se může informace smazat
                </li>
                <li>
                    Tři stopy
                </li>
            </ul>
            <p>
                <img src="data:image/jpeg;base64,">
                <strong>
                    Magnetick&aacute; hystereze
                </strong>
            </p>
            <ul>
                <li>
                    č&iacute;m je smyčka &scaron;ir&scaron;&iacute;, t&iacute;m je magnetick&yacute; materi&aacute;l tvrd&scaron;&iacute;
                </li>
                <li>
                    H &ndash; intenzita mg. pole
                </li>
                <li>
                    B &ndash; mg. indukce
                </li>
                <li>
                    Br &ndash; remanence=zbytkov&yacute; magnetismus
                </li>
                <li>
                    Hc &ndash; koercitivn&iacute; s&iacute;la &ndash; jak intenzivn&iacute; mg. pole mus&iacute; b&yacute;t, aby do&scaron;lo ke změně polarity
                </li>
            </ul>
